          <a href="/mouse0270/bootstrap-notify/commit/4ed0351388d381f5c223282b3ff8a91827ea4f8e" class="message" data-pjax="true" title="many fixes

Fixed an issue with exit animations not properly displaying when mixed
(say FadeIn and SlideOut).

Created a function (notifyCloseExcept) that allows closing flashes
except for certain types of flashes (so, you can persist Warnings but
not Infos). Expanded NotiftyClose() to support passing in notification
types to remove only those types of notifications and added the ability
to include arbitrary jquery selectors to target  removing notifications
in more ways.">many fixes</a>
